(1, NULL, '<p style=\"text-align: right; line-height: 1;\"><img src=\"http://localhost/mhp_web/mhp_server/public/logo/logo.png\" alt=\"\" width=\"91\" style=\"float: left;\" height=\"63\"></p>\n      <p style=\"text-align: right; line-height: 1;\"><span style=\"color: rgb(106, 168, 79);\"><strong style=\"font-family: Tahoma, Geneva, sans-serif;\">&nbsp; Macrohealthplus Medical Centre</strong></span></p>\n      <p style=\"text-align: right; line-height: 1;\"><span style=\"color: rgb(106, 168, 79);\">+01 234 567 889 | info@macrohealthplus.com</span></p>\n      <hr>\n      <p><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\"><strong>2nd Jul 2022</strong></span></p>\n      <p><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\"><strong></strong></span><br><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\"><strong>Re:</strong>   Letter of Medical Necessity</span></p>\n      \n      \n      \n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\"><br></span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\"><strong>Dear Dr. [Bariatric Surgeon’s Name]</strong></span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">I am referring <strong> </strong> for evaluation and consideration for a weight&nbsp;</span><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">management surgical procedure. (S)He currently weighs [# of lbs] pounds and is&nbsp;</span><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">[# of in.] inches tall. Her/His BMI is [BMI #].&nbsp;</span><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">I have been [patient’s name]’s primary care physician for the past [#of yrs] years.</span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">I have supervised several of her/his weight control diets and programs. None of these have resulted in any sustained weight loss. As a result of this persistent morbid obesity, her/his co-morbid conditions are becoming more difficult to manage. These co-morbid</span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">conditions are as follows:</span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">Duration: Medication:</span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">1. Hypertension 3 years Norvasc/Tenormin</span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">2. Diabetes Mellitus 5 years Glucophage</span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">3. Obesity Related Depression 3 years Prozac</span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">Losing weight will certainly make these conditions easier to manage. Since non-surgical programs have failed to provide any long-term benefits for the patient, I feel surgery is her/his only option.</span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">I hope you will find <strong> </strong> a suitable candidate for the surgical weight&nbsp;</span><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">reduction program. It will provide a tool to assist her/him in losing weight, as well as maintain that weight loss. I anticipate that this will provide her/him with a significantly&nbsp;</span><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">improved quality of life.</span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\"><br></span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">Sincerely,</span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\"><strong>Aminur Rahman</strong></span></p>\n      <p style=\"text-align: justify;\"><span style=\"font-family: Tahoma, Geneva, sans-serif; font-size: 14px;\">[Signature]</span></p>', '1', 'Doctor', '2022-07-02 03:34:11', '2022-07-02 03:34:11'),
